    the individuals who contributed in excess of $200 in the election cycle.  This
    report is being amended to report this information for the contributors that have
    responded to the campaigns Best Efforts requests and to provide a detailed description
    of the campaigns procedures for requesting the information.  Best Efforts procedures
    were used to obtain this information.  In the campaigns original solicitation
    the request of the contributors information was clear and conspicuous and informed
    the contributor of the requirement of federal law for the campaigns requirement
    to report such information.  (11 CFR Section 104.7(b)(1))  If the information
    was not provided, the campaign made one follow-up, stand alone effort to obtain
    this information.  This effort occurred after receipt of the contribution and
    was normally in the form of a written request.  (11 CFR Section 104.7(b)(2))  The
    request clearly asked for the missing information, without soliciting a contribution,
    informed the contributor of the requirements of federal law for the reporting
    of such information, and where appropriate, included a pre-addressed return envelope.
